import { Component } from "react";
import api from "./OpenAI";

class OpenAINLP extends Component {
    constructor(props) {
        super(props);
        this.api = api;
    }

    getPetNames(specie) {
        return this.api
        .post("nlp-pet-name/",{
            specie: 'dog'
        })
        .then((response) => response.data)
        .catch((err) => {
            console.error("ops! ocorreu um erro" + err);
        });
    }
}

export default OpenAINLP;
